import { useEffect, useState } from "react";

const Projects = () => {
  const iconArr = [
    <i class="fa-brands fa-python"></i>,
    <link
      type="image/png"
      sizes="16x16"
      rel="icon"
      href=".../icons8-flask-16.png"
    ></link>,
  ];
  const [projects, setProjects] = useState([
    {
      name: "Stock Portfolio Web App",
      stack: "Python, Flask, React, Firebase",
      url: "https://pynance.netlify.app/",
    },
  ]);

  useEffect(() => {});
  return (
    <main className="projects">
      <h3>Projects</h3>
      {projects.map((project) => {
        return (
          <section className="project">
            <h3>{project.name}</h3>
            <div className="interactive">
              <iframe src={`${project.url}`} title={`${project.name}`}></iframe>
            </div>
            <div className="tech-stack">Tech Stack:</div>
          </section>
        );
      })}
    </main>
  );
};
export default Projects;
